import './App.css';
import "./Componants/main.css"
import {BrowserRouter as Router,Routes, Route, Link} from "react-router-dom";

import Home  from "./Componants/Home";
import AboutUs from './Componants/AboutUs';
import Contact from './Componants/Contact';
import Service from './Componants/Service';
import HeaderNav from './Componants/HeaderNav';
import Footer from './Componants/footer';

import AddUser from './Componants/AddUser';
import Userlist from './Pages/Userlist';

import Leftnav from './Componants/leftnav';
//import CustomerList from './Componants/CustomerList';


function App() {
  return (
    <>
      {/*  Router section end */}


<HeaderNav/>
<Router>  
          <div className="App">    
          <div className="container main ">
            <div className="row">
                    <div className="col-sm-2 pt-5">
                    <Leftnav/>
                    </div>
                    <div className="col-sm-10 pt-5">

                    </div>
              </div>
          </div>


          <Routes>  
            {/*     <Route exact path='/' element={< Home />}></Route>   */}
                <Route exact path='/about' element={< AddUser />}></Route>  
                <Route exact path='/contact' element={< Userlist />}></Route>  
          </Routes>  
          </div>  
      </Router>  
<Footer/>
</>
  );
}

export default App;
